// SPDX-License-Identifier: UNLICENSED
pragma solidity ^ 0.8.9;

/**
tutto il codice viene eseguito quando un blocco viene estratto 
in modo che i miner definiscano data ed ora (timing) nel blocco
**/

contract Prova{

    address public owner;

    uint256 val;

    //Per le stringhe conviene sempre usare byte32 in quanto occupano meno spazio
    bytes32 public name = "Gino";

    //Mapping: dizionario chiave valore in questo caso balances Ã¨ un dizionario che associa ad ogni indirizzo un valore (il conto)
    mapping(address => uint256) public balances;

    struct Person{
        uint256 age;
        string name;
    }

    uint256[] vec;

    //now or block.timestamp return the same value

    address sender = msg.sender; //indirizzo del mittente
    uint256 gas = gasleft(); //gas rimanente
    uint256 value = msg.value; //valore in wei inviato al contratto
    bytes data = msg.data; //dati inviati al contratto
    bytes32 sig = msg.sig; //prima 4 byte della funzione chiamata
    uint256 data_lenght = msg.data.length; //lunghezza dei dati inviati al contratto

    function edit_value(uint256 _val) public {
        val = _val;
    }

}

